    <iframe src="javascript:false" class="traverseContainer" style="width: 0px; height: 0px; border: 0px;" src="./saved_resource(3).html"></iframe><script type="text/javascript">
        var getParamsFromUrl = function() {
          var query = location.search.substr(1);
          var result = {};
          var part;
          var queryParts = query.split("&");
          for (var i = 0; i < queryParts.length; i++){
            part = queryParts[i];
            if(part){
              part = part.split("+").join(" ");
              var eq = part.indexOf("=");
              var key = eq>-1 ? part.substr(0,eq) : part;
              var val = eq>-1 ? decodeURIComponent(part.substr(eq+1)) : "";
              var from = key.indexOf("[");
              if(from==-1) result[decodeURIComponent(key)] = val;
              else {
                var to = key.indexOf("]");
                var index = decodeURIComponent(key.substring(from+1,to));
                key = decodeURIComponent(key.substring(0,from));
                if(!result[key]) result[key] = [];
                if(!index) result[key].push(val);
                else result[key][index] = val;
              }
            }
          }
          return result;
        }
        var urlParams = getParamsFromUrl();

        TraverseContainer.start(urlParams);
    </script>
